var imgData = 'data:image/jpg;base64,';

var ImageFilter = function(el) {
  var self = this;
  var img = document.createElement('img');

  self.filters = {
    grayscale: 0,
    blur: 0
  };

  img.src = imgData;
  img.onload = function() {
    el.innerHTML = '';
    el.appendChild( img );
  };

  document.getElementById('btn-bw').addEventListener('click', function() {
    self.filters.grayscale = 1;
    self.applyFilters();
  });

  document.getElementById('btn-frame').addEventListener('click', function() {
    img.classList.add('framed-img');
  });

  document.getElementById('btn-blur').addEventListener('click', function() {
    self.filters.blur = 0 ? 1 : self.filters.blur + 0.2;
    self.applyFilters();
  });

  self.applyFilters = function() {
    img.style.webkitFilter = 'grayscale(' + self.filters.grayscale + ') blur(' + self.filters.blur + 'px)';
  };
};

